import React, {Component} from 'react';
import ps5 from './src/PS5.jpeg'

import {Container, Row, Col, Image} from "react-bootstrap";

class Home extends Component {
    render() {
        return (
            <div>
                <Container>
                <Row>
                    <Col xs={6} md={4}>
                    
                    <li><a href='https://arizonaatwork.com'><img src='PS5.jpeg'/></a></li>
                    </Col>
                </Row>
                </Container>
            </div>
        );
    }
}

export default Home;
